  false,\n\t\"url\": null,\n\t\"notes\": \"Customers applying for a Building permit
  will create a web-based on-line Building permit application.  As part of an initial
  review within the Building permit process, the zoning plan examination will be conducted
  to ensure compliance with the City of Chicagou2019s Zoning Ordinance which regulates
  land use.  The applicant is able to schedule and be seen by a zoning plan examiner
  on average within two (2) business days from the date of the on-line application.
  \ An applicant may receive zoning approval within the first scheduled appointment
  if they have followed the instructions and do not require administrative relief
  for their project.  If administrative relief or corrections are required, the applicant
  can re-submit the application for immediate review and approval upon completion
  of the corrections or administrative process.  An applicant typically requires two
  plan review visits before the Department of Housing and Economic Development is
  able to approve the zoning part of the building permit.\",\n\t\"license_title\":
